import { useEffect, useState } from 'react'
import * as api from './frontend/api'
import * as db from './frontend/database'
import './App.css';


function App() {
  const [view, setView] = useState('')

  return (
    <div className='parent'>

      <div className='first'>
        <button style={{ width: '5vw' }} onClick={() => setView('db')}>Database</button>
        <button style={{ width: '5vw' }} onClick={() => setView('api')}>Api</button>
      </div>

      <div className='second'>
        <input style={{ width: '10vw', height: '2vh' }} placeholder="Søk bruker eller Champion" />
        <button style={{ width: '3vw', height: '2.5vh' }}>Søk</button>
      </div>

      <div className='third'>
        {view === 'db' ? 'database' : 'api'}
      </div>

    </div>
  )
}

export default App
